      if (!isDiff && currCharacter === s[nextIndex]) {
        newString += s[nextIndex];
        testString.push(newString);
        result += 1;
        continue;
      } else if (!isDiff && currCharacter !== s[nextIndex]) {
        isDiff = true;
      } else if (isDiff && currCharacter !== s[nextIndex]) {
      }
      newString += s[nextIndex];

